var emission = {
	kerosin: {
		'per100': 1300,
		'estimated': 0
	},
	dioxide: {
		'per100': 2600,
		'estimated': 0
	}
};





Object.size = function(obj) {
    var size = 0, key;
    for (key in obj) {
        if (obj.hasOwnProperty(key)) size++;
    }
    return size;
};

var getData = function (req,res){
	var json = '';
	var flightData = new Array();

	async.series([
    	function(callback){
    		request(api_url, function (error, response, body) {
			  if (!error && response.statusCode == 200) {
			  	json = JSON.parse(body)
			  	callback();
			  }
			});
    	},
    	function(callback){
    		var size = Object.size(json);
    		var count = 0;
    		var loaded = 0;
    		for(var key in json){
    			count++;
    			request(api_detail_url + 'f='+ key +'&altitude='+ json[key][4] +'&equip_hint='+ json[key][8] +'&format=2&_='+ json[key][10], function (error, response, body) {
				  if (!error && response.statusCode == 200) {
				  		var data = JSON.parse(body)
				  		loaded++;
						for(var k in data){
							flightData.push(data[k])
						}
						if(count == size && count == loaded){
							callback();
						}
				  }
				});
			}			
    	}
	],function(err, results){
		console.log(flightData)
	});
}

