var planeCounter = function(data, dataAirlines){
	for(var e in data){
		if(e != 'stats' && typeof data[e] === 'object'){

			var shortcut = data[e][16].match(/([A-Z])+/);
			for(var s in shortcut){
				if(typeof(dataAirlines[shortcut[s]]) !== 'undefined'){
					if(typeof dataAirlines[shortcut[s]].amount === 'undefined') dataAirlines[shortcut[s]].amount = 0;		

					dataAirlines[shortcut[s]].amount += 1;

					// Wenn das Feld 1 ist, dann ist der Flieger auf dem Boden
					if(data[e][14] == 1){
						dataAirlines[shortcut[s]].ground += 1;
						dataAirlines[shortcut[s]].planes.ground.push(data[e]);
					} else {
						dataAirlines[shortcut[s]].air += 1;
						dataAirlines[shortcut[s]].planes.air.push(data[e]);
					}
				}
				if(s == '0') break;
			}
		}
	}

	for(var e in dataAirlines){
		if(dataAirlines[e].amount == 0) delete airlines[e];
	}
	return dataAirlines;
}

var getAirlines = function (req,res){
	var data ='';
	  
	var returnVar = JSON.parse(JSON.stringify(airlines));

	request(api_url, function (error, response, body) {
	  if (!error && response.statusCode == 200) {
	  	data = JSON.parse(body)

	  	returnVar = planeCounter(data,returnVar);

		request(api_url_only_ground, function (error, response, body) {
			if (!error && response.statusCode == 200) {
				data = JSON.parse(body);
				returnVar = planeCounter(data,returnVar);

				res.send(returnVar).status(200).end();
			}
		});
	
	  }
	});
}

var getEmissions = function (req,res){
	var dataset;
	var returnEmissions = JSON.parse(JSON.stringify(emission));
	// var returnEmissions = emission;
	// -> ergibt Scoping Fehler Mengenangabe
	
	request(api_url, function (error, response, body) {
		if (!error && response.statusCode == 200) {
			dataset = JSON.parse(body);
			var test = 0;
			for(var c in dataset){
				if(c != 'stats' && typeof dataset[c] === 'object'){

					if(dataset[c][14] == 0){
						test += returnEmissions.kerosin.per100;
						returnEmissions.kerosin.estimated += returnEmissions.kerosin.per100;
						returnEmissions.dioxide.estimated += returnEmissions.dioxide.per100;
					}
				}
			}
					console.log(test, returnEmissions.kerosin.estimated, emission.kerosin.estimated);

			res.send(returnEmissions).status(200).end();
		}
	});
}

